import React, { Component } from 'react'
import Item from '../Item'

export default class List extends Component {
  render() {
    return (
      <ul className="todo-main">
        <Item />
        <li>
          <label>
            <input type="checkbox" />
            <span>yyyy</span>
          </label>
          <button className="btn btn-danger" style={{ display: 'none' }}>
            删除
          </button>
        </li>
      </ul>
    )
  }
}
